function GetOrders() {
    return (
        <div>GetBrand</div>
    )
}
function UpdateOrders() {
    return (
        <div>UpdateBrand</div>
    )
}

export default function Orders() {
    return (
        <div className={styles['controlPanel-']}></div>
    )
}
